def deletetask(request):
    req = json.loads(request.body)
    stay = req['stay']
    tasklist = Tasks.objects.all()
    for task in tasklist:
        flag = False
        for st in stay:
            if st==task.id:
                flag=True
        if flag==False:
            task.delete()
    return HttpResponse("ok")

